import React, { useState, useEffect } from "react";
import "./career.css";

export default function AboutUs() {
  const [activeFAQ, setActiveFAQ] = useState(null);

  const faqData = [
    {
      question: "What makes WhatNew different?",
      answer:
        "WhatNew is built for community-driven commerce where discovery is fast, social, and fun."
    },
    {
      question: "How can sellers join?",
      answer:
        "Sellers can apply directly on our platform. Once approved, they get access to powerful tools to grow sales."
    },
    {
      question: "Is WhatNew available worldwide?",
      answer:
        "We are expanding globally. Currently, the marketplace supports selected regions."
    },
  ];

  /* ==========================
     Fade-in / Fade-up Observer
     ========================== */
  useEffect(() => {
    const elements = document.querySelectorAll(".fade-in, .fade-up");

    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add("show");
          }
        });
      },
      { threshold: 0.2 }
    );

    elements.forEach((el) => observer.observe(el));

    return () => observer.disconnect();
  }, []);

  return (
    <div>
      {/* HERO */}
      <section className="wn-hero">
        <h2 className="fade-in">Building the future of commerce, together</h2>
      </section>

      {/* OUR MISSION */}
      <section className="wn-mission">
        <h1 className="wn-title fade-in">Our Mission</h1>
        <p className="wn-text fade-in">
          We are committed to building the world’s most community-driven commerce
          platform. A place where buyers and sellers connect through trust,
          curiosity, and passion.
        </p>

        <div className="wn-stats">
          <article className="wn-card fade-up">
            <h2>10M+</h2>
            <p>Monthly shoppers</p>
          </article>

          <article className="wn-card fade-up">
            <h2>150K+</h2>
            <p>Sellers and creators</p>
          </article>

          <article className="wn-card fade-up">
            <h2>25+</h2>
            <p>Countries served</p>
          </article>
        </div>
      </section>

      {/* COMMUNITY */}
      <section className="wn-community">
        <h2 className="wn-heading fade-in">
          Community is at the heart of everything we do
        </h2>

        <p className="wn-desc fade-in">
          Our marketplace thrives on connection. Every conversation, every
          purchase, and every discovery shapes the WhatNew ecosystem.
        </p>

        <img
          className="fade-up"
          src="/assets/Group839.png"
          alt="Community"
        />
      </section>

      {/* FUTURE COMMERCE */}
      <section className="wn-future">
        <h2 className="wn-fc-heading fade-in">
          Building the future of commerce
        </h2>

        <p className="wn-fc-desc fade-in">
          We’re creating a platform that empowers everyone—buyers, sellers,
          creators—to thrive in a joyful, safe, and interactive marketplace.
        </p>

        <button className="wn-fc-button fade-in">Learn Work About Here</button>

        <img
          className="fade-up"
          src="/assets/group0.jpg"
          alt="Team"
        />
      </section>

      {/* QUOTE SECTION */}
      <section className="wn-quote">
        <div className="quote-text fade-in">
          <h3>
            “We acquire more customers on WhatNew in a week than we do in our
            stores in a year.”
          </h3>
          <p>— Courtney Cook, Seller</p>
        </div>

        <div className="quote-media fade-up">
          <img
            src="/assets/cook.jpeg"
            alt="Courtney Cook"
          />
        </div>
      </section>

      {/* FAQ */}
      <section className="wn-faq">
        <h2 className="wn-heading fade-in">Frequently Asked Questions</h2>

        <div className="faq-container">
          {faqData.map((faq, index) => (
            <div
              key={index}
              className={`faq1-item fade-up ${activeFAQ === index ? "active" : ""}`}
              onClick={() =>
                setActiveFAQ(activeFAQ === index ? null : index)
              }
            >
              <div className="faq1-question">
                {faq.question}
                <span>{activeFAQ === index ? "-" : "+"}</span>
              </div>

              {activeFAQ === index && (
                <div className="faq1-answer">{faq.answer}</div>
              )}
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}
